import CardPromo from "./CardPromo/CardPromo";

export default function ({ cards, step, setStep }) {

  return (
    <div>
      {
        cards.map(card => (
          <CardPromo key={card.id} card={card} step={step} setStep={setStep} />
        ))
      }
    </div>
  );
}
